import styled from 'styled-components'

// Components
import { Title, Duration, Detail } from '../text'

const Wrapper = styled.div`
  width: 50%;
  max-width: 400px;
  padding: 0 20px;
  background: green;
  position: absolute;
  top: 0;
  left: 50%;
`

class Content extends Component {
  render() {
    return (
      <Wrapper>
        <Title>Title</Title>
        <Duration>2018</Duration>
        <Detail>การบ้าน eieieieiei</Detail>
      </Wrapper>
    )
  }
}

export default Content
